def parse_iso8601(date_str, delimiter='T', timezone=None):
    """
    Return a UNIX timestamp from the given date.
    Delimiter corresponds to the time delimiter (e.g. 2023-10-19T0:00:00+00:0)
    """
    import datetime

    try:
        dt = datetime.datetime.strptime(date_str, "%Y-%m-%d" + delimiter + "%H:%M:%S%z")
        return str(int(dt.timestamp()))
    except ValueError:
        return None
